import React from "react";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faTrash, faCirclePlus } from "@fortawesome/free-solid-svg-icons";

const Single = (props) => {
	return (
		<div className="component">
			<div className="paper-shadow-z-1">
				<input
					type="text"
					placeholder="Fibre"
					id="access-structures"
					value={props.item.name}
				/>
			</div>
			<button
				type="button"
				className="button ExtraButton"
				onClick={() => {
					console.log("Deleteing ", props.item.id);
					props.removeElement(props.item.id);
				}}
			>
				<FontAwesomeIcon icon={faTrash} />
			</button>
		</div>
	);
};

export default Single;
